    private void checkSkuId(String skuId, long expectedCode) {
        // The seller public key to issue SKU Tokens.
        String sellerPrivateKey = "privC15YAp4M4oDLcJ6JqyPqYH55VXPeNckE2AVqWcHN8BB4PAVwGjJr";
        // The seller address.
        String sellerAddress = "buQfTPaQBzFGBzGy87pSsc6MmNJKKKmzTSyC";
        // The default tranche.
        // Notice: If this is not setting, the default tranche of id '0' will be used.
        String defaultTrancheId = "1";
        // The spu id.
        // Notice: If this is not setting, this sku tokens don't have spu.
        String spuId = "000000001";
        // The sku label.
        // The sku label.
        JSONArray skuLabel = new JSONArray();
        skuLabel.add("iphone");
        skuLabel.add("iphone 5s");
        skuLabel.add("iphone 5s ");
        skuLabel.add("iphone 5s  64G");
        skuLabel.add("iphone 5s  64G ");
        // The address that will be sent SKU Tokens when the cash finishes.
        String redemptionAddress = "buQqudnoPPV2utx92jfdcLkFGDaB7v3iasPM";
        // The sku reference price.
        String skuPrice = "3000";
        // The sku color.
        String skuColor = "";
        // The sku memory.
        String skuMemory = "64";
        // The sku model.
        String skuModel = "";
        // The sku abstract
        JSONArray skuAbstract = new JSONArray();
        skuAbstract.add("1");
        skuAbstract.add("3");
        skuAbstract.add("2");
        // The token name
        String skuName = "iphone 5s  64G ";
        // The token symbol.
        String tokenSymbol = "IPWSFC";
        // The token supply.
        String tokenSupply = "1";
        // The token decimals.
        String decimals = "0";
        // Whether the tokens with ids.
        Boolean withTokenIds = true;
        // The token ids.
        JSONArray tokenIds = new JSONArray();
        tokenIds.add("1");
        // The token description.
        String skuDesc = "iphone 5s  64G ";
        // The main icon
        String mainIcon = "png|https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1557751338635&di=3f6b989903ddf1cf9c10cc530c849d93&imgtype=0&src=http%3A%2F%2Fimg.zcool.cn%2Fcommunity%2F01815657c24f1b0000012e7eb901a1.jpg|md5|2938472190312847";
        // The vice icons
        JSONArray viceIcons = new JSONArray();
        viceIcons.add(mainIcon);
        // The acceptance ids
        JSONArray acceptanceIds = new JSONArray();
        acceptanceIds.add("1");
        // The sku attributes
        Atp60TokenDemo atp60TokenDemo = new Atp60TokenDemo();
        JSONObject attributes = new JSONObject();
        attributes.put("id", atp60TokenDemo.buildAdditionIndex("parentId", "name", "type", "value", "decimals", "uint"));
        attributes.put("1", atp60TokenDemo.buildAdditionIndex("0",         "", "int",  skuPrice,     "-",       "CNY"));
        attributes.put("2", atp60TokenDemo.buildAdditionIndex("0",         "",  "text",  skuColor,   "-",        "-"));
        attributes.put("3", atp60TokenDemo.buildAdditionIndex("0",         "",  "int",   skuMemory,       "-",        "G"));
        attributes.put("4", atp60TokenDemo.buildAdditionIndex("0",         "",  "text",  skuModel, "-",       "-"));

        // Issuing SKU Tokens.
        String txHash = atp60TokenDemo.issueSKUTokensTx(sellerPrivateKey, sellerAddress, skuId, defaultTrancheId, spuId, skuName, tokenSymbol, tokenSupply, decimals, withTokenIds, tokenIds, skuDesc, mainIcon, viceIcons, skuLabel, redemptionAddress, acceptanceIds, skuAbstract, attributes);

        // Check Tx status.
        JSONObject result = atp60TokenDemo.getTxStatus(txHash);
        System.out.println(JSON.toJSONString(result, true));
        assertEquals(result.getString("desc"), expectedCode, result.getIntValue("code"));
    }

